import React from "react";
import { Col, Row } from "react-bootstrap";
import "./About.css";

const About = () => {
    return (
        <div className="about-banner">
           <Row>
               <Col> <img src="" alt="" /> </Col>
               <Col></Col>
           </Row>
        </div>
    );
};

export default About;
